```python
def binary_search(arr, x, low=0, high=len(arr)-1):
    while low <= high:
        mid = (low + high) \/\/ 2
        if arr[mid] == x:
            return mid
        elif arr[mid] < x:
            low = mid + 1
        else:
            high = mid - 1
    return -1  # Element not found
```
This function takes an array `arr`, an element `x` to search for, and optional `low` and `high` indices to search within. It uses a binary search algorithm to find the index of the element `x` in the array, or `-1` if the element is not found.

The `while` loop continues until `low` is greater than `high`. At each iteration, the midpoint `mid` is calculated by taking the average of `low` and `high`. If the element `x` is found at index `mid`, the function returns `mid`. If the element is less than `x`, the search proceeds to the right half of the array by setting `low = mid + 1`. If the element is greater than `x`, the search proceeds to the left half of the array by setting `high = mid - 1`.

If the element `x` is not found in the array, the function returns `-1`.

