En C, vous pouvez utiliser la fonction `memset` pour supprimer toutes les occurrences de 0 dans un tableau. Voici un exemple :
```
#include <stdio.h>

int main() {
    int array[5] = {0, 1, 2, 3, 0};
    int new_array[5];

    \/\/ Supprimer les occurrences de 0 dans l'array original
    memset(array, 0, sizeof(array));

    \/\/ Copier les éléments de l'array original dans le nouveau tableau
    memcpy(new_array, array, sizeof(array));

    \/\/ Afficher les éléments du nouveau tableau
    for (int i = 0; i < sizeof(array); i++) {
        printf("%d ", new_array[i]);
    }
    printf("\n");

    return 0;
}
```
Dans cet exemple, la fonction `memset` est utilisée pour remplir tous les éléments de l'array `array` de 0. Puis, la fonction `memcpy` est utilisée pour copier les éléments de l'array `array` dans un nouveau tableau `new_array`. Enfin, les éléments de `new_array` sont affichés utilisant une boucle `for`.

Voici les résultats attendus :
```
1 2 3 4 5
```
Notez que si l'array original contient des éléments autres que 0, ils seront conservés dans le nouveau tableau.

