```python
import time
from threading import *

# Define the Pomodoro timer
class PomodoroTimer:
    def __init__(self, pomodoro_time=25, short_break=5, long_break=15):
        self.pomodoro_time = pomodoro_time * 60
        self.short_break = short_break * 60
        self.long_break = long_break * 60
        self.is_running = False

    def start_timer(self, duration):
        self.is_running = True
        for remaining in range(duration, 0, -1):
            if not self.is_running:
                break
            mins, secs = divmod(remaining, 60)
            timer = '{:02d}:{:02d}'.format(mins, secs)
            print("\rTime left: " + timer, end="")
            time.sleep(1)
        self.is_running = False
        if remaining == 0:
            print("\nTimer finished!")

    def start_pomodoro(self):
        print("Starting Pomodoro...")
        self.start_timer(self.pomodoro_time)

    def start_short_break(self):
        print("Starting short break...")
        self.start_timer(self.short_break)

    def start_long_break(self):
        print("Starting long break...")
        self.start_timer(self.long_break)

    def stop_timer(self):
        self.is_running = False

# Define the To-Do List
class TodoList:
    def __init__(self):
        self.tasks = []

    def add_task(self, task):
        self.tasks.append(task)
        print(f"Added task: {task}")

    def remove_task(self, task):
        if task in self.tasks:
            self.tasks.remove(task)
            print(f"Removed task: {task}")
        else:
            print("Task not found in the list.")

    def show_tasks(self):
        print("\nTo-Do List:")
        for idx, task in enumerate(self.tasks, 1):
            print(f"{idx}. {task}")

# Main application
def main():
    timer = PomodoroTimer()
    todo_list = TodoList()

    while True:
        print("\nOptions:")
        print("1. Add a task")
        print("2. Remove a task")
        print("3. Show tasks")
        print("4. Start Pomodoro")
        print("5. Start short break")
        print("6. Start long break")
        print("7. Stop timer")
        print("8. Exit")

        choice = input("Enter your choice: ")

        if choice == '1':
            task = input("Enter the task: ")
            todo_list.add_task(task)
        elif choice == '2':
            task = input("Enter the task to remove: ")
            todo_list.remove_task(task)
        elif choice == '3':
            todo_list.show_tasks()
        elif choice == '4':
            timer.start_pomodoro()
        elif choice == '5':
            timer.start_short_break()
        elif choice == '6':
            timer.start_long_break()
        elif choice == '7':
            timer.stop_timer()
        elif choice == '8':
            print("Exiting the app.")
            break
        else:
            print("Invalid choice. Please try again.")

if __name__ == "__main__":
    main()
```

This Python script uses the `time` module to create timer functionality and a simple to-do list to manage tasks. The `PomodoroTimer` class handles the Pomodoro, short break, and long break durations, while the `TodoList` class manages the tasks. 

To use the app, simply run the Python script, and it will present you with a CLI menu where you can add tasks, remove tasks, show tasks, start the Pomodoro timer, start short or long breaks, stop the timer, or exit the app.

Please note that this is a basic example and can be further developed to include features like notifications, GUI, task persistence (saving to a file or database), and more advanced task management functionalities.

