Here is a simple PlayerController component that can be added to an entity in the s&box scene system to control player movement:

```csharp
public class PlayerController : EntityComponent<PlayerController> {

    [Scene] private Scene _scene;

    public float Speed = 5f;

    public override void OnTick(float dt) {
        var input = _scene.Input;

        \/\/ Get movement input
        var moveX = input.GetKey(Key.A) ? -1 : 0;
        moveX += input.GetKey(Key.D) ? 1 : 0;        
        var moveY = input.GetKey(Key.W) ? 1 : 0;
        moveY -= input.GetKey(Key.S) ? -1 : 0;

        \/\/ Normalize diagonal movement
        var move = new Vector2(moveX, moveY);
        if (move.LengthSquared > 1f) 
            move.Normalize();

        \/\/ Update position
        Entity.Transform.Position += move * Speed * dt;
    }

}
```

To use it, simply add this component to a player entity. It will allow WASD movement with the given speed. The OnTick method gets called each frame to update the movement based on input.

